using System;
using System.Collections.Generic;
using System.Drawing;
using System.Linq;
using System.Reflection;
using System.Text;
using System.Threading.Tasks;
using System.Windows.Media.Imaging;
using Shawn.Ulits;

namespace PRM.Core.Protocol
{
    public class ProtocolServerIcons
    {
        #region singleton
        private static ProtocolServerIcons uniqueInstance;
        private static readonly object InstanceLock = new object();

        public static ProtocolServerIcons Instance
        {
            get
            {
                lock (InstanceLock)
                {
                    if (uniqueInstance == null)
                    {
                        uniqueInstance = new ProtocolServerIcons();
                    }
                }
                return uniqueInstance;
            }
        }

        #endregion

        private ProtocolServerIcons()
        {
            var type = typeof(ProtocolServerIcons);
            var fields = type.GetFields(BindingFlags.NonPublic | BindingFlags.Static);
            foreach (var field in fields)
            {
                if (field.FieldType == typeof(string))
                {
                    var str = (string)field.GetValue(this);
                    var img = NetImageProcessHelper.BitmapFromBase64(str);
                    Icons.Add(img.ToBitmapImage());
                }
            }
        }
        private const string Win10 = "";
        private const string Win7 = "";
        private const string Linux = "";
        private const string Ubuntu = "";
        private const string CentOs = "";
        private const string RaspberryPi = "";
        private const string Apple = "";
        private const string Java = "";
        private const string AspNet = "";
        private const string Php = "";
        private const string Python = "";
        private const string WordPress = "";
        private const string Docker = "";
        private const string NodeJs = "";
        private const string Gitlab = "";

        public List<BitmapSource> Icons { get; set; } = new List<BitmapSource>();
    }
}
